    def random_int_str(self, count: int, first_zero: bool = False):
        """
        生成指定长度的随机数据字符串
        :param count: 长度
        :param first_zero: 生成的数字字符串 首位是否可以为零
        :return: 字符串数字
        """
        if first_zero:
            return self.__random_base(count, self.NUMBER)
        else:
            while True:
                value = self.__random_base(count, self.NUMBER)
                if str(value[0]) != '0':
                    return value

    def random_lower_str(self, count: int):
        """
        生成指定长度的随机小写字母字符串
        :param count: 长度
        :return:
        """
        return self.__random_base(count, self.LOWER)

    def random_upper_str(self, count: int):
        """
        生成指定长度的随机大写字母字符串
        :param count: 长度
        :return:
        """
        return self.__random_base(count, self.UPPER)

    def random_low_upp_str(self, count: int):
        """
        生成指定长度的随机字母（大、小写）字符串
        :param count: 长度
        :return:
        """
        return self.__random_base(count, self.LOWER_UPPER)

    def random_low_upp_number_str(self, count: int):
        """
        生成指定长度的随机字符（大小写字母+数字）
        :param count: 长度
        :return:
        """
        return self.__random_base(count, self.NUMBER_LOWER_UPPER)

    def random_low_number_str(self, count: int):
        """
        生成指定长度的随机字符（小写字母+数字）
        :param count: 长度
        :return:
        """
        return self.__random_base(count, self.NUMBER_LOWER)

    def random_upp_number_str(self, count: int):
        """
        生成指定长度的随机字符（大写字母+数字）
        :param count: 长度
        :return:
        """
        return self.__random_base(count, self.NUMBER_UPPER)

    def random_name_str(self, gender, is_two_xing=False):
        """
        生成随机姓名
        :param gender: 性别（男、女）
        :param is_two_xing: 姓是否是2个字的（默认是1一个字的姓）
        """
        # step1 生成姓
        xing = ''
        if is_two_xing:
            while True:
                xing_two = self.NAME_XING[random.randint(0, len(self.NAME_XING) - 1)]
                if len(xing_two) == 2:
                    xing = xing_two
                    break
        else:
            while True:
                xing_one = self.NAME_XING[random.randint(0, len(self.NAME_XING) - 1)]
                if len(xing_one) == 1:
                    xing = xing_one
                    break

        # step2 生成名
        ming = ''
        if gender == '男':
            ming = self.NAME_BODY_MING[random.randint(0, len(self.NAME_BODY_MING) - 1)]
        elif gender == '女':
            ming = self.NAME_GIRL_MING[random.randint(0, len(self.NAME_GIRL_MING) - 1)]
        else:
            print('性别错误')

        return xing + ming

    @staticmethod
    def random_ip():
        """
        随机IP地址
        :return:
        """
        ip = '{}.{}.{}.{}'.format(
            random.randint(1, 223),
            random.randint(0, 255),
            random.randint(0, 255),
            random.randint(0, 255)
        )
        return ip

    @staticmethod
    def __random_base(count: int, type):
        value = ''
        for c in range(count):
            value += str(type[random.randint(0, len(type) - 1)])
        return value


